import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Card, Icon } from 'semantic-ui-react'


class Test extends Component {
  render() {
    return (
        <div class="ui card">
        <div class="content"><div class="header">About Amy</div></div>
        <div class="content">
          <div class="description">
            Amy is a violinist with 2 years experience in the wedding industry. She
            enjoys the outdoors and currently resides in upstate New York.
          </div>
        </div>
        <div class="extra content">
          <i aria-hidden="true" class="user icon"></i>4 Friends
        </div>
      </div>
    );
  }
}

export default Test;
